description:
Little Voice ar en otroligt charmig film om den sjukligt blyga unga ficka,
vars enda intresse ar att spela sin pappas gamla stenkakor och imitera
rosterna pa dem. Det ar tidlosa roster som bl.a. Judy Garland och Marilyn
Monroe. Allt framfores av Jane Horrocks (mest sedd som sekreteraren 
&quot;Bubbles&quot; i Helt Hysteriskt).
Med bl.a. Brenda Blethyn, Michael Caine ocg Ewan McGregor.
